import React, { useEffect, useState } from "react";
import "./InteractionPercentage.css";
import axios from 'axios';

const InteractionPercentage = () => {
  const [data, setData] = useState([]);
  const [showLoading, setShowLoading] = useState(false);

  const totalInteractions = data

  useEffect(() => {
    setShowLoading(true)
    axios.get(`http://localhost:8080/interactions`)
    .then(res => {
      const interactions = res.data;
      setData(interactions);
      setShowLoading(false)
    })
  }, [])

  return (
    <div style={{width:"52vw", height:"auto", paddingLeft:"20px", textAlign:"center"}}>
        <dl>
            <dt>
                Interactions by percentage
            </dt>
                <dd className="percentage percentage-11"><span className="text">IE 11: 11.33%</span></dd>
                <dd className="percentage percentage-49"><span className="text">Chrome: 49.77%</span></dd>
                <dd className="percentage percentage-16"><span className="text">Firefox: 16.09%</span></dd>
                <dd className="percentage percentage-5"><span className="text">Safari: 5.41%</span></dd>
                <dd className="percentage percentage-2"><span className="text">Opera: 1.62%</span></dd>
                <dd className="percentage percentage-2"><span className="text">Android 4.4: 2%</span></dd>
                <dd className="percentage percentage-11"><span className="text">IE 11: 11.33%</span></dd>
                <dd className="percentage percentage-49"><span className="text">Chrome: 49.77%</span></dd>
                <dd className="percentage percentage-16"><span className="text">Firefox: 16.09%</span></dd>
                <dd className="percentage percentage-5"><span className="text">Safari: 5.41%</span></dd>
                <dd className="percentage percentage-2"><span className="text">Opera: 1.62%</span></dd>
        </dl>
    </div>
  )
}

export default InteractionPercentage;
